import React from 'react';

const TextArea = () => {
  return (
    <div style={styles.textArea}>
      <p>kdj</p>
      <p>jlas</p>
    </div>
  );
};

const styles = {
  textArea: {
    borderTopLeftRadius: '1rem',
    borderTopRightRadius: '1rem',
    width: '100%',
    paddingBottom: '30%',
    background: '#A2A2BD'
  }
};

export default TextArea;
